import React from 'react';
import { ListCart } from './style';

const CartProduct = ({ currentSale }) => {
  return (
    <ListCart>
      {currentSale.map(({ id, name, category, img }) => (
        <li key={id}>
          <div className=''>
            <img src={img} alt={name} />
          </div>
          <h3>{name}</h3>
          <span>{category}</span>
          <button type="button">Remover</button>
        </li>
      ))}
    </ListCart>
  );
};

export default CartProduct;
